import React, { useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import "../App.css";

const Navbar = () => {
  const navigate = useNavigate();
  const [menuOpen, setMenuOpen] = useState(false);

  const handleLogout = () => {
    navigate("/login"); // redirect to login
  };

  return (
    <header className="navbar">
      <div className="logo">Admin Panel</div>

      {/* Hamburger Icon */}
      <div
        className={`hamburger ${menuOpen ? "active" : ""}`}
        onClick={() => setMenuOpen(!menuOpen)}
      >
        <span></span>
        <span></span>
        <span></span>
      </div>

      {/* Navigation Links */}
      <nav className={`nav-links ${menuOpen ? "open" : ""}`}>
        <Link to="/dashboard" onClick={() => setMenuOpen(false)}>
          Dashboard
        </Link>
        <Link to="/pending-partners" onClick={() => setMenuOpen(false)}>
          Pending Partners
        </Link>
        <Link to="/approved-partners" onClick={() => setMenuOpen(false)}>
          Approved Partners
        </Link>
        <Link to="/slots" onClick={() => setMenuOpen(false)}>
          Slot Manager
        </Link>
        <Link to="/rate-card" onClick={() => setMenuOpen(false)}>
          Rate Card
        </Link>
        <Link to="/partner-earnings" onClick={() => setMenuOpen(false)}>
          Partner Earnings
        </Link>
        <button className="logout-btn" onClick={handleLogout}>
          Logout
        </button>
      </nav>
    </header>
  );
};

export default Navbar;
